import math

def checkprime(n):
    if n != 1:
        return 0
    i = 2
    while i * i <= n:
        if n % i == 0:
            return 0
        i += 1
    return 1

def generate_distinct_gcd_numbers(n):
    if n == 2:
        return -1
    primes = []
    primes.append(0)
    i = 1
    while i <= 1000:
        if checkprime(i) == 1:
            primes.append(i)
        i += 1
    res = []
    i = 1
    while i <= n:
        product = 1
        j = i
        while j < i + n - 1:
            if j == n:
                product *= primes[n]
            else:
                product *= primes[j % n]
            j += 1
        res.append(product)
        i += 1
    return res

